    labels: ['Jan', 'Feb', 'Mar', 'Apr', 'May'],
    datasets: [
      {
        label: 'Sales for 2020 (M)',
        data: [3, 2, 2, 1, 5]
      }
    ]
  }
  return (
    <div className="App">
      {/* <Line data={data} /> */}
      <div className='chart'>
        <LineChart />
       </div>
    </div>
  );
}

export default App;
